- input: "TEXT\x1CC00279901\x1CX0\x1C\x1CF3XA\x1CWe are resubmitting our Pre-General
    2012 Report. It was recently discovered that Yolanda J. DuBois, Harvey Fernbach,
    and Nathan J. Robfogel had duplicate records in our database. The records each
    had an aggregate of less than $200.01 so the contributions were not itemized on
    the original report. Additionally, it was discovered that unitemized expenses
    totaling $7.98 to American Express for banking fees were not included in our original
    filing.    Please be assured that we are taking all necessary steps to ensure
    that these transactions and banking fees are properly reported in the future.
